import { prototype } from "events";
import React from "react";

export default function Ingredient(props) {
  let iconButton;
  if (props.type === "requests") {
    iconButton = (
      <i className="fa-regular fa-trash-can icon-button delete-button"></i>
    );
  } else if (props.type === "results") {
    iconButton = (
      <i className="fa-solid fa-arrow-rotate-left icon-button add-button"></i>
    );
  }

  return (
    <div className="ingredient-container">
      <div className="ingredient">{props.value}</div>
      {iconButton}
    </div>
  );
}
